import React, { createContext,useState } from "react";

export const NavigationsCon = createContext();

export const NavigationsConPro = (props) => {
  const [navigation, setNavigations] = React.useState("Hello");
  return (
    <NavigationsCon.Provider value={{ navigation, setNavigations }}>
      {props.children}
    </NavigationsCon.Provider>
  );
};
